import React from "react";

const Menu = ({allMenus}) => {

  return (
    <div className="section-center">
      {allMenus.map(item => (
          <article className="menu-item">
          <img src={item.img} className="photo" />
          <div className="item-info">
            <header>
              <h4>{item.title}</h4>
              <h4 className="price">${item.price}</h4>
            </header>
            <p className="item-text">{item.desc}</p>
          </div>
        </article>
      ))}
    </div>
  );
};

export default Menu;
